import { createUseStyles } from "react-jss";

const Perforators = () => {

    const styles = createUseStyles({
        perforators: {
            height: "100%",
            backgroundImage: "url(/images/perforators.png)",
            backgroundRepeat: "no-repeat",
            backgroundSize: "100% 100%"
        }
    });

    const classes = styles()

    return (
        <div className={classes.perforators}>
            <div className="slider__inner">
                <h3 className="slider__title">Перфораторы</h3>
                <p className="slider__desc">Настоящие мужские игрушки</p>
                <a className="slider__link" href="link">Открыть Каталог</a>
            </div>
        </div>
    )
}

export default Perforators
